import { JSX_EXT, TSX_EXT, extsToEslintGlobs } from "@/shared/globs";
import { configAlloyReact, pluginReact, pluginReactHooks } from "@/shared/modules";

import type { ESLintConfig, ReactConfig, ReactOverride } from "../types";

export const react = (
    config: ReactConfig,
    override: ReactOverride,
): ESLintConfig<ReactOverride>[] => {
    const { useTypescript, version = "detect" } = config;
    const files = extsToEslintGlobs(JSX_EXT, TSX_EXT);

    return [
        {
            name: "goodbyenjn:react:common",
            plugins: {
                react: pluginReact,
                "react-hooks": pluginReactHooks,
            },
            settings: {
                react: { version },
            },
        },
        {
            name: "goodbyenjn:react:rules",
            files,
            languageOptions: {
                parserOptions: {
                    ecmaFeatures: {
                        jsx: true,
                    },
                },
            },
            rules: {
                "react-hooks/rules-of-hooks": "error",
                "react-hooks/exhaustive-deps": "warn",
                ...configAlloyReact.rules,
                ...(useTypescript ? { "react/jsx-no-undef": "off" } : {}),
                ...override,
            },
        },
    ];
};

import { JS_EXT, JSX_EXT, VUE_EXT, SRC_EXT, extsToEslintGlobs } from "@/shared/globs";
import { configAlloyTypescript, parserTypescript, pluginTypescript } from "@/shared/modules";

import type { ESLintConfig, TypeScriptConfig, TypeScriptOverride } from "../types";

export const typescript = (
    config: TypeScriptConfig,
    override: TypeScriptOverride,
): ESLintConfig<TypeScriptOverride>[] => {
    const { useVue, parserOptions } = config;
    const extraFileExtensions: string[] = [];
    const files = extsToEslintGlobs(SRC_EXT);

    if (useVue) {
        extraFileExtensions.push(".vue");
        files.push(...extsToEslintGlobs(VUE_EXT));
    }

    return [
        {
            name: "goodbyenjn:typescript:common",
            plugins: { "@typescript-eslint": pluginTypescript },
        },
        {
            name: "goodbyenjn:typescript:parser",
            files,
            languageOptions: {
                parser: parserTypescript,
                parserOptions: {
                    sourceType: "module",
                    ecmaVersion: 2022,
                    ecmaFeatures: {
                        jsx: true,
                        globalReturn: false,
                    },
                    extraFileExtensions,
                    project: false,
                    projectService: false,

                    ...parserOptions,
                },
            },
        },
        {
            name: "goodbyenjn:typescript:rules",
            files,
            rules: {
                ...configAlloyTypescript.rules,

                "no-undef": "off",
                "no-unused-vars": "off",
                "@typescript-eslint/no-empty-interface": "off",
                "@typescript-eslint/no-invalid-this": "off",
                "@typescript-eslint/no-invalid-void-type": "off",
                "@typescript-eslint/no-unused-vars": [
                    "warn",
                    { varsIgnorePattern: "^_", argsIgnorePattern: "^_", ignoreRestSiblings: true },
                ],
                "@typescript-eslint/explicit-member-accessibility": "off",

                ...override,
            },
        },
        // {
        //     name: "goodbyenjn:typescript:type-aware-parser",
        //     files: [GLOB_TS, GLOB_TSX],
        //     languageOptions: {
        //         parser: parserTypescript,
        //         parserOptions: {
        //             sourceType: "module",
        //             ecmaVersion: 2022,
        //             ecmaFeatures: {
        //                 jsx: true,
        //                 globalReturn: false,
        //             },
        //             extraFileExtensions,
        //             ...project,

        //             ...parserOptions,
        //         },
        //     },
        // },
        // {
        //     name: "goodbyenjn:typescript:parser",
        //     files: [GLOB_SRC, ...extraFiles],
        //     ignores: [GLOB_TS, GLOB_TSX],
        //     languageOptions: {
        //         parser: parserTypescript,
        //         parserOptions: {
        //             sourceType: "module",
        //             ecmaVersion: 2022,
        //             ecmaFeatures: {
        //                 jsx: true,
        //                 globalReturn: false,
        //             },
        //             extraFileExtensions,

        //             ...parserOptions,
        //         },
        //     },
        // },
        {
            files: extsToEslintGlobs(JS_EXT, JSX_EXT),
            name: "goodbyenjn:typescript:js-override",
            rules: {
                "@typescript-eslint/no-require-imports": "off",
                "@typescript-eslint/no-var-requires": "off",
            },
        },
    ];
};

import { VUE_EXT, extsToEslintGlobs } from "@/shared/globs";
import { configAlloyVue, parserTypescript, parserVue, pluginVue } from "@/shared/modules";

import type { ESLintConfig, VueConfig, VueOverride } from "../types";

const {
    "vue/component-tags-order": ComponentTagsOrderRuleConfig,
    "vue/no-ref-object-destructure": NoRefObjectDestructureRuleConfig,
    "vue/no-setup-props-destructure": NoSetupPropsDestructureRuleConfig,
    ...configAlloyVueRules
} = configAlloyVue.rules;

export const vue = (config: VueConfig, override: VueOverride): ESLintConfig<VueOverride>[] => {
    const { useTypescript } = config;
    const files = extsToEslintGlobs(VUE_EXT);

    return [
        {
            name: "goodbyenjn:vue:common",
            plugins: {
                vue: pluginVue,
            },
        },
        {
            name: "goodbyenjn:vue:rules",
            files,
            languageOptions: {
                parser: parserVue,
                parserOptions: {
                    ecmaFeatures: {
                        jsx: true,
                    },
                    extraFileExtensions: [".vue"],
                    parser: useTypescript ? parserTypescript : undefined,
                    sourceType: "module",
                },
            },
            rules: {
                ...configAlloyVueRules,
                "vue/block-order": ComponentTagsOrderRuleConfig,
                "vue/no-ref-object-reactivity-loss": NoRefObjectDestructureRuleConfig,
                "vue/no-setup-props-reactivity-loss": NoSetupPropsDestructureRuleConfig,

                // https://github.com/vuejs/eslint-plugin-vue/issues/2356
                "vue/comment-directive": "off",

                ...override,
            },
        },
    ];
};

import {
    defaults,
    gitignore,
    ignores,
    jsonc,
    plugins,
    javascript,
    typescript,
    yaml,
} from "./configs";
import { parseOverrideOptions } from "./options";

import type { Options, PrettierConfig } from "./types";

export type { Options, Overrides } from "./types";

export const withConfig = (options: Options = {}): PrettierConfig => {
    const overrides = parseOverrideOptions(options);

    return {
        ...defaults(options),

        ...plugins(options),

        overrides: [
            gitignore(),
            ignores(options),
            javascript(),
            jsonc(),
            typescript(),
            yaml(),
            ...overrides,
        ],
    };
};
